  \"2016-03-07T18:31:50.760068\",\n\t\"name\": \"swfsc-mmtd-etp-dolphin-tuna-tracking-studies-dtts-1992-1993\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This research was designed to better understand
  the nature of the dolphin-tuna bond in the eastern tropical Pacific Ocean.  In this
  study, researchers attempted to capture spotted dolphins and tunas from the same
  aggregation, attach transmitters to as many individuals of each species as practical,
  release them, and monitor their movements. The dolphins and tuna were captured by
  a tuna purse-seiner and tracked from a NOAA research vessel.  This was a collaborative
  research effort by NOAA National Marine Fisheries Service (NMFS) Southwest Fisheries
  Science Center (SWFSC), the Inter-American Tropical Tuna Commission (IATTC), and
  the University of Hawaii.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
